import React, { useState } from 'react';
import { Eye, EyeOff, AlertCircle, LogIn, User, Phone } from 'lucide-react';

const LoginPage = () => {
    const [phone, setPhone] = useState('0944233773');
    const [password, setPassword] = useState('');
    const [showPassword, setShowPassword] = useState(false);
    const [error, setError] = useState('');
    const [isLoading, setIsLoading] = useState(false);

    const handleSubmit = async(e) => {
        e.preventDefault();
        setIsLoading(true);
        setError('');

        // Validate inputs
        if (!phone || !password) {
            setError('Please fill in all fields');
            setIsLoading(false);
            return;
        }

        if (phone.length < 10) {
            setError('Please enter a valid phone number');
            setIsLoading(false);
            return;
        }

        try {
            // This would be your actual API call
            const response = await simulateLoginRequest();

            if (!response.ok) {
                throw new Error(`Login failed: Route not found. POST ${response.url} returned ${response.status} (${response.statusText})`);
            }

            // Handle successful login
            console.log('Login successful');

        } catch (err) {
            setError(err.message);
        } finally {
            setIsLoading(false);
        }
    };

    // Function to simulate the API request that's failing
    const simulateLoginRequest = () => {
        return new Promise((resolve, reject) => {
            setTimeout(() => {
                // Simulate a 404 error response
                reject({
                    message: 'Request failed with status code 404',
                    name: 'AxiosError',
                    code: 'ERR_BAD_REQUEST',
                    config: {
                        url: 'https://localhost:8080/api/admin/login',
                        method: 'post'
                    },
                    response: {
                        status: 404,
                        statusText: 'Not Found',
                        data: 'Route not found'
                    }
                });
            }, 1500);
        });
    };

    return ( <
        div style = { styles.container } >
        <
        div style = { styles.loginBox } >
        <
        div style = { styles.header } >
        <
        div style = { styles.logo } >
        <
        User size = { 32 }
        /> <
        /div> <
        h1 style = { styles.title } > Agricultural Portal < /h1> <
        p style = { styles.subtitle } > Login to access your dashboard < /p> <
        /div>

        <
        form onSubmit = { handleSubmit }
        style = { styles.form } >
        <
        div style = { styles.inputGroup } >
        <
        label htmlFor = "phone"
        style = { styles.label } >
        <
        Phone size = { 16 }
        style = {
            { marginRight: '8px' } }
        />
        Phone Number <
        /label> <
        input id = "phone"
        type = "tel"
        value = { phone }
        onChange = {
            (e) => setPhone(e.target.value) }
        style = { styles.input }
        placeholder = "Enter your phone number" /
        >
        <
        /div>

        <
        div style = { styles.inputGroup } >
        <
        label htmlFor = "password"
        style = { styles.label } >
        Password <
        /label> <
        div style = { styles.passwordContainer } >
        <
        input id = "password"
        type = { showPassword ? 'text' : 'password' }
        value = { password }
        onChange = {
            (e) => setPassword(e.target.value) }
        style = { styles.input }
        placeholder = "Enter your password" /
        >
        <
        button type = "button"
        onClick = {
            () => setShowPassword(!showPassword) }
        style = { styles.toggleButton } >
        { showPassword ? < EyeOff size = { 18 } /> : <Eye size={18} / > } <
        /button> <
        /div> <
        /div>

        <
        button type = "submit"
        disabled = { isLoading }
        style = {
            {
                ...styles.loginButton,
                    ...(isLoading ? styles.loginButtonLoading : {})
            }
        } >
        {
            isLoading ? ( <
                div style = { styles.spinner } > < /div>
            ) : ( <
                >
                <
                LogIn size = { 18 }
                style = {
                    { marginRight: '8px' } }
                />
                Login <
                />
            )
        } <
        /button>

        {
            error && ( <
                div style = { styles.errorBox } >
                <
                AlertCircle size = { 18 }
                style = {
                    { marginRight: '8px' } }
                /> <
                span > { error } < /span> <
                /div>
            )
        } <
        /form>

        <
        div style = { styles.links } >
        <
        a href = "#"
        style = { styles.link } > Forgot Password ? < /a> <
        a href = "#"
        style = { styles.link } > Create Account < /a> <
        /div>

        <
        div style = { styles.debugInfo } >
        <
        h3 style = { styles.debugTitle } > Debug Information < /h3> <
        p > Attempted POST request to : < span style = { styles.url } > https: //localhost:8080/api/admin/login</span></p>
        <
        p > Server responded with: 404(Not Found) < /p> <
        p > Please check that the server is running and the endpoint is correct. < /p> <
        /div> <
        /div> <
        /div>
    );
};

const styles = {
    container: {
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        minHeight: '100vh',
        background: 'linear-gradient(135deg, #f5f7fa 0%, #c3cfe2 100%)',
        padding: '20px',
        fontFamily: '"Segoe UI", Tahoma, Geneva, Verdana, sans-serif',
    },
    loginBox: {
        backgroundColor: 'white',
        borderRadius: '12px',
        boxShadow: '0 10px 30px rgba(0, 0, 0, 0.15)',
        width: '100%',
        maxWidth: '420px',
        overflow: 'hidden',
    },
    header: {
        background: 'linear-gradient(135deg, #2d5016 0%, #4a7b2c 100%)',
        color: 'white',
        padding: '25px 20px',
        textAlign: 'center',
    },
    logo: {
        width: '70px',
        height: '70px',
        backgroundColor: 'white',
        borderRadius: '50%',
        margin: '0 auto 15px',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
    },
    title: {
        fontSize: '24px',
        fontWeight: '600',
        marginBottom: '8px',
    },
    subtitle: {
        fontSize: '14px',
        opacity: '0.9',
    },
    form: {
        padding: '25px',
    },
    inputGroup: {
        marginBottom: '20px',
    },
    label: {
        display: 'flex',
        alignItems: 'center',
        marginBottom: '8px',
        fontWeight: '500',
        color: '#333',
        fontSize: '14px',
    },
    input: {
        width: '100%',
        padding: '14px',
        border: '1px solid #ddd',
        borderRadius: '8px',
        fontSize: '16px',
        transition: 'border-color 0.3s',
    },
    passwordContainer: {
        position: 'relative',
    },
    toggleButton: {
        position: 'absolute',
        right: '15px',
        top: '50%',
        transform: 'translateY(-50%)',
        background: 'none',
        border: 'none',
        color: '#777',
        cursor: 'pointer',
    },
    loginButton: {
        width: '100%',
        padding: '14px',
        background: 'linear-gradient(135deg, #2d5016 0%, #4a7b2c 100%)',
        color: 'white',
        border: 'none',
        borderRadius: '8px',
        fontSize: '16px',
        fontWeight: '600',
        cursor: 'pointer',
        transition: 'all 0.3s',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
    },
    loginButtonLoading: {
        opacity: '0.8',
    },
    spinner: {
        border: '2px solid rgba(255, 255, 255, 0.3)',
        borderTop: '2px solid white',
        borderRadius: '50%',
        width: '20px',
        height: '20px',
        animation: 'spin 1s linear infinite',
    },
    errorBox: {
        backgroundColor: '#fee',
        color: '#c33',
        padding: '12px',
        borderRadius: '8px',
        marginTop: '20px',
        display: 'flex',
        alignItems: 'center',
        borderLeft: '4px solid #c33',
        fontSize: '14px',
    },
    links: {
        display: 'flex',
        justifyContent: 'space-between',
        marginTop: '20px',
        padding: '0 25px',
        fontSize: '14px',
    },
    link: {
        color: '#4a7b2c',
        textDecoration: 'none',
    },
    debugInfo: {
        backgroundColor: '#f9f9f9',
        borderRadius: '8px',
        padding: '15px',
        margin: '20px 25px',
        fontSize: '12px',
        color: '#666',
        borderLeft: '4px solid #ddd',
    },
    debugTitle: {
        marginBottom: '10px',
        color: '#555',
        fontSize: '13px',
    },
    url: {
        color: '#c33',
        fontWeight: 'bold',
    },
};

// Add keyframes for spinner animation
const styleSheet = document.styleSheets[0];
styleSheet.insertRule(`
  @keyframes spin {
    0% { transform: rotate(0deg); }
    100% { transform: rotate(360deg); }
  }
`, styleSheet.cssRules.length);

export default LoginPage;
